import React from "react";
import {GoogleMap, Marker, withScriptjs, withGoogleMap} from "react-google-maps";

import styled from "styled-components";

function Map(){
  return(
<GoogleMap defaultZoom={10} defaultCenter={{lat:45.502651,lng:73.555252}}/>
  )
}

const WrappedMap = withScriptjs(withGoogleMap(Map));


const Contact = () => {

// API:  AIzaSyARbNwTVD7DMSu4sn54xXldxmIXRUIZJ4o
  return (
    <>
      <Wrapper>
        <h1>Contact

        </h1>
        <MapDiv>

          <WrappedMap googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places`}/>
        </MapDiv>
      
      </Wrapper>
    </>
  );
};

export default Contact;

const Wrapper = styled.div`
  font-size: 55px;
  color: red;
`;

const MapDiv = styled.div``;
